import React ,{ useState, useEffect } from "react";
import axios from "axios";
import Swal from "sweetalert2";

const [debut, setdebut] = useState("");
const [fin, setfin] = useState("");
const [data, setdata] = useState([]);
const [loading, setLoading] = useState(true);
const url = `http://localhost:5000/api/plein?debut=${debut}&fin=${fin}`;	
let token = `Bearer ${localStorage.getItem("token")}` ;

useEffect(() => {
    axios.get(url,
        {
            headers : {
                Accept: 'application/json',
                'Content-Type' : 'application/json',
                Authorization : token
            }
        }
    ).then((response) => {
        setdata(response.data.data);
        setLoading(false);
    }).catch((error) => {
        alert(error)
    })
}, [])

const Recherche = () => {
    return(
        <div class="card">
           <br />
                <div class="row">
                    <div class="col-md-3">
                        <input type="date" class="form-control" placeholder="Date debut" /> 
                    </div>
                    <div class="col-md-3">
                        <input type="date" class="form-control" placeholder="Date fin" /> 
                    </div>
                    <div class="col-md-3">
                        <button class="btn btn-primary"> <i class="fas fa-search"></i></button>
                    </div>
                </div>
                <div className="card-body">
                  <h5 className="card-title"> <a href="" data-bs-toggle="modal" data-bs-target="#addadmin" className="btn btn-primary"> + Prelevement</a></h5>
                  <div className="table-responsive">
                    <table
                      id="zero_config"
                      className="table table-striped table-bordered"
                    >
                      <thead>
                        <tr>
                          <th>immatriculation</th>
                          <th>Utilisateur</th>
                          <th>Matricule</th>
                          <th>Qte</th>
                          <th>Kilometrage</th>
                          <th>Action</th>
                        </tr>
                      </thead>
                      <tbody>
                        {
                            plein.map((e) => {
                                return (
                                    <tr>
                                        <td>{e.immatriculation}</td>
                                        <td>{e.user}</td>
                                        <td>{e.matricule_ch}</td>
                                        <td>{e.qteplein}</td>
                                        <td>{e.kilometrage}</td>
                                        <td>
                                            <button className="fa fa-edit btn btn-danger"></button>
                                            <button className="fa fa-edit btn btn-primary"></button>
                                        </td>
                                    </tr>
                                );
                            })
                        }
                    </tbody>
                    </table>
                  </div>
                </div>
        </div>
    );
}
export default Recherche;
